Text:
If your system is "x86_64" you have to try is:

"Setup.sh" file to replace the following part from.

Previous:

DetectARCH ()
{
status = 1
case `uname-m` in
i? 86) echo "x86"
status = 0;;
*) Echo "` uname-m `"
status = 0;;
esac
return $ status
}

New:

DetectARCH ()
{
status = 1
case `uname-m` in
i? 86) echo "x86"
status = 0;;
*) Echo "x86"
status = 0;;
esac
return $ status
}
